import { observable, action } from "mobx";
import axios from "axios";

export class admin {
  @observable dbTable = {};
  @observable dbName = "";

  @action
  createTableInfo(num, dbname) {
    console.log(dbname);
    return axios
      .get("https://hanstream.gabia.io/adminCreateFile", {
        params: {
          dbName: dbname,
        },
      })
      .then((response) => {
        alert("추가완료했습니다.");
        console.log(response.data);
        getTable(num, dbname);
      })
      .catch((error) => {
        alert("error");
        console.log(error);
      });
  }
  @action
  async createTable(num, dbname) {
    await this.createTableInfo(num, dbname);
  }
  @action
  getTableInfo(num, dbname) {
    return axios
      .get("https://hanstream.gabia.io/insertDBValue", {
        params: {
          num: num,
          dbName: dbname,
        },
      })
      .then((response) => {
        console.log(response.data);
        this.dbTable = response.data;
      })
      .catch((error) => {
        console.log(error);
      });
  }
  @action
  async getTable(num, dbname) {
    await this.getTableInfo(num, dbname);
  }
}
